import React from 'react';
import '../css/Contact.css';
import { CForm, CFormInput, CFormTextarea, CButton } from '@coreui/react';
import CIcon from '@coreui/icons-react'
import { cilSend } from '@coreui/icons';
import { SocialIcon } from 'react-social-icons';
import 'react-social-icons/linkedin'
import 'react-social-icons/github'
import 'react-social-icons/whatsapp'
import 'react-social-icons/discord'
import 'react-social-icons/facebook'
// import linkedIn from '../assets/images/linkedin.png';
// import whatsApp from '../assets/images/whatsapp.png';
// import skype from '../assets/images/skype.png';
// import facebook from '../assets/images/facebook.png';

const Contact = () => {

    return (
        <div className="cont_container">
            <h2 className="cont_h2">Contact</h2>
            <div className="cont_item">
                <CForm>
                    <CFormInput
                        type="email"
                        id="exampleFormControlInput1"
                        label={<span className="custom_adress">Adresse email</span>}
                        placeholder="adress@example.com"
                        style={{ backgroundColor:'gray', fontSize: '1vw' }}
                    />
                </CForm>
                <CForm style={{ marginTop: '2%', marginBottom: '2%'}}>
                    <CFormTextarea
                        id="exampleFormControlTextarea1"
                        label={<span className="custom_message">Votre message</span>}
                        rows={4}
                        style={{ backgroundColor:'gray', height: '20vh', resize: 'none' }}
                    />
                </CForm>
                <CButton style={{ float: 'right', width:'4vw' }} color='success'>
                    <CIcon icon={cilSend}/>
                </CButton>
                <SocialIcon style={{ width:'2.5vw', height:'5vh' }} url="www.linkedin.com" />
                <SocialIcon style={{ width:'2.5vw', height:'5vh', marginLeft:'1%' }}  url="www.github.com" />
                <SocialIcon style={{ width:'2.5vw', height:'5vh', marginLeft:'1%' }}  url="www.whatsapp.com" />
                <SocialIcon style={{ width:'2.5vw', height:'5vh', marginLeft:'1%' }}  url="www.discord.com" />
                <SocialIcon style={{ width:'2.5vw', height:'5vh', marginLeft:'1%' }}  url="www.facebook.com" />
            </div>
        </div>
    );
};
export default Contact;
